import logo from './logo.svg';
import React from "react";
// import {Routes, Route, Link} from "react-router-dom" 
import './App.css';
import Project from './pages/Project';
import Navbar from './component/Navbar';
function App() {
  return (
    <div className="App">
      <nav>
        <Navbar/>
      </nav>
      <Project/>
      <footer>
        <Footer/>
      </footer>
    </div>
  );
}

export default App;
